const intlTable = {
  payrollTransactionsList: [],
};
interface intlTable {
  payrollTransactionsList: Payroll[];
}
export interface Payroll {
  status: string;
  date: string;
  client: string;
  currentcy: string;
  tolal: number;
  invoice: string;
}
interface Action {
  type: string;
  payload?: any;
}

export default function payrollReducer(state: intlTable = intlTable, action: Action) {
  switch (action.type) {
    default:
      return state;
  }
}
